const College =(props) =>
{
    return(
        <>
          <div class="col">
           <div class="border">
             <h5 class="bg-info"> College name {props.cname} </h5>
             desc: { props.cdata}
               </div>   
          </div>
    
        </>
    )
}
export default College;
